// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract LandRegistration {
    constructor() public {
        owner = msg.sender;
    }


    address owner;
    mapping(uint256 => landDetails) lands;
    mapping(string => address) public admin;
    mapping(address => profiles) profile;

    enum RequestStatus {
        Default,
        pending,
        reject,
        approved
    }

    struct landDetails {
        string state;
        string district;
        string village;
        uint256 surveyNumber;
        address payable CurrentOwner;
        uint256 marketValue;
        bool isAvailable;
        address requester;
        RequestStatus requestStatus;
    }

    struct profiles {
        uint256[] assetList;
    }

    modifier onlyOwner() {
        require(msg.sender == owner);
        _;
    }

    function addSuperAdmin(address _superAdmin, string memory _village)
        public
        onlyOwner
    {
        admin[_village] = _superAdmin;
    }
}
